import React from 'react';
import './App.css';
import { createBrowserRouter, RouterProvider } from 'react-router-dom'; // Importa createBrowserRouter y RouterProvider
import Login from './components/Login';

const router = createBrowserRouter([
  {
    path: '/',
    children: [
      {
        index: true,
        element: <Login /> // Define el componente para la ruta raíz
      },
      {
        path: 'home',
        element: <Home /> // Define el componente para la ruta '/home'
      }
    ]
  }
]);

function App() {
  return (
    <RouterProvider router={router} />
  );
}

export default App;
